const posts = [
    {
        "id" : 1,
        "title" : "Football",
        "body" : "There are some great matches and good"
    },
    {
        "id" : 2,
        "title" : "Volleyball",
        "body" : "There are some great matches"
    },
    {
        "id" : 3,
        "title" : "Baseball",
        "body" : "It's a bad hobby"
    }
];
export default posts;
